import React, { useEffect, useState, useContext } from "react";
import axios from "axios";
import { AuthContext } from "../auth/AuthContext";
import { useNavigate } from "react-router-dom";
import { FaUserCircle } from "react-icons/fa";

const ManageInventory = () => {
    const { deptId, userRole } = useContext(AuthContext);
    const [inventory, setInventory] = useState([]);
    const [selectedItem, setSelectedItem] = useState(null);
    const [itemName, setItemName] = useState("");
    const [itemId, setId] = useState("");
    const [status, setStatus] = useState("");
    const [quantity, setQuantity] = useState("");
    const [room_id, setRoomId] = useState("");
    const [category, setCategory] = useState("");
    const [lastMaintenance, setLastMaintenance] = useState("");
    const navigate = useNavigate();
    const [userName, setUserName] = useState(localStorage.getItem("userName") || "");

    useEffect(() => {
        fetchInventory();
    }, []);

    const fetchInventory = async () => {
        try {
            const token = localStorage.getItem("token");
            const response = await axios.get("http://localhost:8800/api/inventory", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setInventory(response.data);
        } catch (error) {
            console.error("Error fetching inventory:", error);
        }
    };

    const handleAddItem = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem("token");
            await axios.post("http://localhost:8800/api/inventory", {
                item_id: itemId,
                i_name: itemName,
                category,
                quantity,
                room_id,
                status,
                last_maintenance_date: lastMaintenance,
            }, { headers: { Authorization: `Bearer ${token}` } });
            alert("Inventory item added successfully!");
            fetchInventory();
            resetForm();
        } catch (error) {
            console.error("Error adding item:", error);
        }
    };

    const resetForm = () => {
        setItemName("");
        setCategory("");
        setQuantity("");
        setRoomId("");
        setStatus("");
        setLastMaintenance("");
        setSelectedItem(null);
    };

    return (
        <div style={{ fontFamily: "Arial, sans-serif", padding: "20px" }}>
            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                <button onClick={() => navigate(-1)} style={{ margin: "10px" }}>‚Üê Back</button>
                <h1>Manage Inventory</h1>
                <FaUserCircle size={50} />
            </div>
            <div style={{ marginTop: "20px" }}>
                <h2>Add New Item</h2>
                <form onSubmit={handleAddItem} style={{ display: "grid", gap: "10px", maxWidth: "300px" }}>
                    <input type="text" placeholder="Item ID" value={itemId} onChange={(e) => setId(e.target.value)} />
                    <input type="text" placeholder="Item Name" value={itemName} onChange={(e) => setItemName(e.target.value)} />
                    <input type="text" placeholder="Category" value={category} onChange={(e) => setCategory(e.target.value)} />
                    <input type="number" placeholder="Quantity" value={quantity} onChange={(e) => setQuantity(e.target.value)} />
                    <input type="text" placeholder="Room ID" value={room_id} onChange={(e) => setRoomId(e.target.value)} />
                    <input type="text" placeholder="Status" value={status} onChange={(e) => setStatus(e.target.value)} />
                    <input type="date" placeholder="Last Maintenance" value={lastMaintenance} onChange={(e) => setLastMaintenance(e.target.value)} />
                    <button type="submit">Add Item</button>
                </form>
            </div>
        </div>
    );
};

export default ManageInventory;
